	public int maximumGain(String s, int x, int y) {
		int max = 0;
		String maxSub = x >= y ? "ab" : "ba";
		String minSub = maxSub.equals("ba") ? "ab" : "ba";
		int maxSum = x >= y ? x : y;
		int minSum = x >= y ? y : x;
		char[] chars = s.toCharArray();
		char[] newChars = new char[s.length()];

		Set<Integer> visited = new HashSet<>();

		int k = 0;
		int lastIndex = -2;
		for (int i = 0, j = 1; i < s.length() - 1 && j < s.length();) {
			if (i >= 0 && s.charAt(i) == maxSub.charAt(0) && s.charAt(j) == maxSub.charAt(1)) {
				visited.add(i);
				visited.add(j);
				max += maxSum;
				chars[i] = '\0';
				chars[j] = '\0';
				if (lastIndex != -2) {
					i = lastIndex;
					lastIndex = -2;
				} else {
					do {
						i = i - 1;
					} while (visited.contains(i));
				}
				k = k == 0 ? k : k - 1;
				j = j + 1;
				continue;
			}
			if (i >= 0) {
				newChars[k++] = s.charAt(i);
			}
			if (j == s.length() - 1) {
				newChars[k++] = s.charAt(j);
			}
			j++;
			lastIndex = i;
			i = j - 1;
		}

		String newS = new String(newChars);

		lastIndex = -2;
		visited = new HashSet<>();
		for (int i = 0, j = 1; i <= k - 1 && j <= k;) {
			if (i >= 0 && newS.charAt(i) == minSub.charAt(0) && newS.charAt(j) == minSub.charAt(1)) {
				max += minSum;
				if (lastIndex != -2) {
					i = lastIndex;
					lastIndex = -2;
				} else {
					do {
						i = i - 1;
					} while (visited.contains(i));
				}
				j = j + 1;
				continue;
			}
			j++;
			lastIndex = i;
			i = j - 1;
		}
		return max;
	}

	public int maximumGain_NotBest(String s, int x, int y) {
		int max = 0;
		String maxSub = x >= y ? "ab" : "ba";
		String minSub = maxSub.equals("ba") ? "ab" : "ba";
		int maxSum = x >= y ? x : y;
		int minSum = x >= y ? y : x;

		for (int i = -1, j = 0; i < s.length() - 2 && j < s.length() - 1;) {
			if (s.charAt(i + 1) == maxSub.charAt(0) && s.charAt(j + 1) == maxSub.charAt(1)) {
				s = s.replaceFirst(maxSub, "");
				max += maxSum;
				i = i < 0 ? i : i - 1;
				j = i + 1;
				continue;
			}
			i++;
			j++;
		}
		for (int i = -1, j = 0; i < s.length() - 2 && j < s.length() - 1;) {
			if (s.charAt(i + 1) == minSub.charAt(0) && s.charAt(j + 1) == minSub.charAt(1)) {
				s = s.replaceFirst(minSub, "");
				max += minSum;
				i = i < 0 ? i : i - 1;
				j = i + 1;
				continue;
			}
			i++;
			j++;
		}
		return max;
	}

	public int maximumGain_BadSolution(String s, int x, int y) {
		remove(s, "ab", 0, x, y);
		remove(s, "ba", 0, x, y);
		return max;
	}

	public void remove(String input, String subS, int earned, int x, int y) {
		if (!input.contains("ab") && !input.contains("ba")) {
			if (earned > max) {
				max = earned;
			}
			return;
		}
		String s = null;
		if (input.contains(subS)) {
			s = input.replaceFirst(subS, "");
			if ("ab".equals(subS)) {
				earned += x;
			} else {
				earned += y;
			}
		}
		if (s.contains("ab")) {
			remove(s, "ab", earned, x, y);
		}
		if (s.contains("ba")) {
			remove(s, "ba", earned, x, y);
		}

		if (!s.contains("ab") && !s.contains("ba")) {
			if (earned > max) {
				max = earned;
			}
			return;
		}
	}
